import React from "react";

const Chat = () => {
  return (
    <div className="flex items-center justify-center h-full">
      <div className="w-1/3 h-[600px] bg-white">
        <div className="">
          <input type="text" placeholder="message send" />
          <button>SEND</button>
        </div>
      </div>
    </div>
  );
};

export default Chat;
